preSideTransitionSequence:
@printerscript 1.0
//*******************//
// tuning parameters //
//*******************//

// motor current to use when engaging the mechanism, in mA
motorCurrentHigh = 450

// lift the print head if not at least this high, in mm
minZ = 15


//********//
// script //
//********//

"; *** Pre-purge G-code ***"
""
"M907 X{{motorCurrentHigh}} ; set current of X motor"
"M106 S0 ; turn off fan"
"G92 E0 ; reset extrusion distance"
"G1 Y100 F{{xyTravelSpeed * 60}} ; break string before Z lift"
"G1 X{{nextX - 55.1}} F{{xyTravelSpeed * 60}} ; move head into position"
if (currentZ < minZ) {
  "G1 Z{{minZ}} F{{zTravelSpeed * 60}}"
}
"G4 S0 ; clear movement buffer"
"G1 X{{nextX - 5.1}} F{{xyTravelSpeed * 60}} ; move head to purge zone"
"G1 X{{nextX}} F1000 ; extend purge arm" // might need to tweak
""

